raw.css:
.body {
	a {@apply underline}
}

.links {
	@apply flex mt-2;
	a {
    	@apply text-white font-bold uppercase text-sm text-center block transition-colors duration-200;
        @apply px-5 py-3 mt-4 mr-4;
    }
	a:first-child {
    	@apply bg-indigo-500;
        &:hover {@apply bg-indigo-400}
    }
    a:not(:first-child) {
    	@apply border-2 border-indigo-400;
        &:hover {@apply bg-indigo-400}
    }
}

