let toggled = false
window.toggleMessage = function(node) {
	toggled = !toggled
    node.textContent = toggled ? 'Show' : 'Hide'
    const container = node.parentNode.parentNode
    const body = container.querySelector('[data-content]')
    body.classList.toggle('hidden')
}

